```def quarter_of(month):
    if month &lt; 4:
        return 1
    elif month &gt;= 4 and month &lt; 7:
        return 2
    elif month &gt;=7 and month &lt; 10:
        return 3
    elif month &gt;=10 and month &lt;= 12:
        return 4
    else: 
        return "this is not a month number"```

